            else if (ddl_name == "Prv" && value == null)
            {
                //searchAMR.hos_code = null;
            }
            else if (ddl_name == "Prv" && value != null)
            {
                var prv_select = lab_ddl_List.FirstOrDefault(x => x.prv_code == value.ToString());

                searchAMR.arh_code = prv_select.arh_code;
            }

            StateHasChanged();
        }


